import React from 'react';

import NavigationItem from '../NavigationItems/NavigationItem/NavigationItem';

import NavigationItemsStyle from './NavigationItems.css';


const navigationItems = (props) => {



  const navItems = [
    {id: 'shop', text: 'Shop', link: '/', auth: false},
    {id: 'add-product', text: 'Add Product', auth: true},
    {id: 'admin-products', text: 'Admin Products', auth: true},
    {id: 'cart', text: 'Cart', auth: true}
  ]





  let authenticate = (
    <NavigationItem link={'/auth'} closed={props.closed}>
      Get Started
    </NavigationItem>
  );

  if (props.logout) {
    authenticate = (
      <NavigationItem link={'/logout'} closed={props.closed} style={{}}>
        Logout
      </NavigationItem>
    );
  }

  return (
    <ul className={NavigationItemsStyle.NavigationItems}>
      <NavigationItem closed={props.closed} link={'/'}>
        Shop
      </NavigationItem>
      {props.logout ? (
        <NavigationItem link={'/orders'} closed={props.closed}>
          Orders
        </NavigationItem>
      ) : null}

      {authenticate}
    </ul>
  );
};

export default navigationItems;
